import { Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      name: {firstName: "Sveta",lastName: "Shmukler"},
      city: "Rishon Lezion"
    }
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>Hi my name is {this.state.name.firstName} {this.state.name.lastName}, I live in {this.state.city} .</p>
          <button 
            onClick={() => {
              this.setState (
                () => { 
                  return {name: {firstName : "Michal", lastName: "Khmelnitsky"}};
                },
                () => {
                  console.log(this.state)
                }
              );
            }}
          >
            Change Name
          </button>

        </header>
      </div>
    );
  }
}


export default App;
